const SpreadSpin = (
  number: number,
  spX: number,
  spY: number,
  endX: number,
  endY: number,
  rotZ: number
) => keyframes`
    0% {
      transform: rotateZ(${number * 90}deg) translate(0px, 0px);
    }
    30% {
      transform: rotateZ(${number * 90}deg) translate(${spX}px, ${spY}px);
    }
    70% {
      transform: rotateZ(${
        number * 90 + rotZ
      }deg) translate(${spX}px, ${spY}px);
    }
    100% {
      transform: rotateZ(${
        number * 90 + rotZ
      }deg) translate(${endX}px, ${endY}px);
    }
`;

